import React from "react";
import { useAuth0 } from "@auth0/auth0-react";
import "./Header.css";

function Header() {
  const { loginWithRedirect, isAuthenticated, logout, user } = useAuth0();

  return (
    <header className="header">
      <h1 className="header-logo">Organ Tracker</h1>
      <nav className="header-nav">
        {!isAuthenticated ? (
          <>
            <button onClick={() => loginWithRedirect()} className="auth-btn">Login</button>
            <button onClick={() => loginWithRedirect({ screen_hint: "signup" })} className="auth-btn">Sign Up</button>
          </>
        ) : (
          <>
            <p>Welcome, {user.name}!</p>
            <button onClick={() => logout({ returnTo: window.location.origin })} className="auth-btn">Logout</button>
          </>
        )}
      </nav>
    </header>
  );
}

export default Header;
